import { BrowserRouter, Route } from 'react-router-dom'
import Header from './components/Header.js'
import Merch from './pages/merch';

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Route exact path='/merch' component={Merch}></Route>
    </BrowserRouter>

  )
}

export default App
